var fileJSON=[{"path":"/root/yan/lbm/fpga/lbm/device/boundary_detector.cl", "name":"boundary_detector.cl", "has_active_debug_locs":false, "absName":"/root/yan/lbm/fpga/lbm/device/boundary_detector.cl", "content":"/**\012detecte boundary condition\012*/\012TASK AUTORUN kernel void boundary_detector()\012{\012    while (true)\012    {\012        // get cellvector.cells[N_Vector][N_Vector] from dr\012        CellVector cellvector = read_channel_intel(DATAR2BD_CELLVECTOR_CHANNEL);\012        if (DEBUG)\012            printf(\"boundary_detector getting Group data...\\n\");\012\012        // define boundary datas\012        CellWithBoundaryVector cellwbvector;\012        Vector2DIndex offsets[N_VECTOR][N_VECTOR];\012\012        // flag for mask the boundary cell\012        bool flag = false;\012        int i = 0;\012        int j = 0;\012#pragma unroll\012        for (int n = 0; n < N_VECTOR * N_VECTOR; n++)\012        {\012            Vector2DIndex offset = MakeVecIndex(0, 0);\012            Cell cell = cellvector.cells[j][i];\012            // get offset(x,y)\012            char mask = cellvector.cells[j][i].mask;\012            if (ISUP(mask))\012                offset.y = -1;\012            else if (ISDOWN(mask))\012                offset.y = 1;\012            if (ISRIGHT(mask))\012                offset.x = -1;\012            else if (ISLEFT(mask))\012                offset.x = 1;\012            if (DEBUG)\012                printf(\"boundary_detector: cells(%d,%d).offset=(%d,%d)\\n\", cell.position.x, cell.position.y, offset.x, offset.y);\012            // if has offset mask\012            if (mask != 0x0)\012            {\012                flag = true;\012                // set boundary.rho\012                cellvector.cells[j][i].rho = cellvector.cells[j + offset.y][i + offset.x].rho;\012            }\012            offsets[j][i] = offset;\012            // compute index(j,i)\012            if (++i == N_VECTOR)\012            {\012                i = 0;\012                j++;\012            }\012        }\012        // #pragma unroll\012        //         for (int j = 0; j < N_VECTOR; j++)\012        //         {\012        // #pragma unroll\012        //             for (int i = 0; i < N_VECTOR; i++)\012        //             {\012        //                 Vector2DIndex offset = MakeVecIndex(0, 0);\012        //                 Cell cell = cellvector.cells[j][i];\012        //                 // get offset(x,y)\012        //                 char mask = cellvector.cells[j][i].mask;\012        //                 if (ISUP(mask))\012        //                     offset.y = -1;\012        //                 else if (ISDOWN(mask))\012        //                     offset.y = 1;\012        //                 if (ISRIGHT(mask))\012        //                     offset.x = -1;\012        //                 else if (ISLEFT(mask))\012        //                     offset.x = 1;\012        //                 if (DEBUG)\012        //                     printf(\"boundary_detector: cells(%d,%d).offset=(%d,%d)\\n\", cell.position.x, cell.position.y, offset.x, offset.y);\012        //                 // if has offset mask\012        //                 if (mask != 0x0)\012        //                 {\012        //                     flag = true;\012        //                     cellvector.cells[j][i].rho = cellvector.cells[j + offset.y][i + offset.x].rho;\012        //                 }\012        //                 offsets[j][i] = offset;\012        //             }\012        //         }\012\012        // transfer cellvector.cells[N_Vector][N_Vector] to cu\012        write_channel_intel(BD2CU_CELLVECTOR_CHANNEL, cellvector);\012\012        if (flag)\012        {\012            int j = 0;\012            int i = 0;\012#pragma unroll\012            for (int n = 0; n < N_VECTOR * N_VECTOR; n++)\012            {\012                cellwbvector.cellwbs[j][i].offset = offsets[j][i];\012                cellwbvector.cellwbs[j][i].cell = cellvector.cells[j][i];\012                if (++i == N_VECTOR)\012                {\012                    i = 0;\012                    j++;\012                }\012            }\012            // #pragma unroll\012            //             for (int j = 0; j < N_VECTOR; j++)\012            //             {\012            // #pragma unroll\012            //                 for (int i = 0; i < N_VECTOR; i++)\012            //                 {\012            //                     cellwbvector.cellwbs[j][i].offset = offsets[j][i];\012            //                     cellwbvector.cellwbs[j][i].cell = cellvector.cells[j][i];\012            //                 }\012            //             }\012            // transfer data to bu\012            write_channel_intel(BD2BU_CWBV_CHANNEL, cellwbvector);\012        }\012    }\012}"}, {"path":"/root/yan/lbm/fpga/lbm/device/boundary_streamer.cl", "name":"boundary_streamer.cl", "has_active_debug_locs":false, "absName":"/root/yan/lbm/fpga/lbm/device/boundary_streamer.cl", "content":"/**\012writer cell data from global buffer */\012TASK kernel void boundary_streamer(\012    global Cell *restrict cells,\012    LongIndex ncells, Index size_x, Index size_y)\012{\012    bool buf_flag = false;\012    Vector2DIndex size = MakeVecIndex(size_x, size_y);\012    // LongIndex count_flag = (size.x + size.y - 2); // avoide divide\012    LongIndex count_flag = 0; // avoide divide\012    LongIndex fullsize = (size.x + size.y - 2) * 2;\012    LongIndex count = fullsize;\012    LongIndex offset = ncells;\012\012#pragma ivdep\012    while (true)\012    {\012        Cell boundary = read_channel_intel(BU2BSTREAMER_CELL_CHANNEL);\012        if (DEBUG)\012            printf(\"boundary_streamer: getted data from bu count=%d\\n\", count);\012        LongIndex cellIndex = getIndex(boundary.position, size) + offset;\012        cells[cellIndex] = boundary;\012        count--;\012        if (count == count_flag)\012            write_channel_intel(BSTREAMER2DATAR_CHAR_CHANNEL, '1');\012        if (count == 0)\012        {\012            count = fullsize;\012            // ping-pong buffer, using offset\012            offset = 0;\012            if (buf_flag)\012                offset = ncells;\012            buf_flag = !buf_flag;\012        }\012    }\012}"}, {"path":"/root/yan/lbm/fpga/lbm/device/bu.cl", "name":"bu.cl", "has_active_debug_locs":false, "absName":"/root/yan/lbm/fpga/lbm/device/bu.cl", "content":"/**\012处理边界\012数据 struct BoundaryWithInterior\012{\012    Vector2D position;\012    Vector2D u;\012    Cell cell_interior;\012};*/\012TASK AUTORUN kernel void bu()\012{\012    while (true)\012    {\012        CellWithBoundaryVector cellwbvector = read_channel_intel(BD2BU_CWBV_CHANNEL);\012        int x = 0;\012        int y = 0;\012        for (int m = 0; m < N_VECTOR * N_VECTOR; m++)\012        {\012            Cell cell = cellwbvector.cellwbs[y][x].cell;\012            if (cell.mask != 0x0)\012            {\012                Vector2DIndex offset = cellwbvector.cellwbs[y][x].offset;\012                Cell cell_interior = cellwbvector.cellwbs[y + offset.y][x + offset.x].cell;\012                for (int i = 0; i < Q_VECTOR; i++)\012                {\012                    cell.f[i] = nfeq_boundary(cell_interior.f[i], cell_interior.rho, cell_interior.u, cell.u, i);\012                }\012                write_channel_intel(BU2BSTREAMER_CELL_CHANNEL, cell);\012            }\012\012            //compute index\012            if (++x == N_VECTOR)\012            {\012                x = 0;\012                y++;\012            }\012        }\012    }\012}"}, {"path":"/root/yan/lbm/fpga/lbm/device/cu.cl", "name":"cu.cl", "has_active_debug_locs":false, "absName":"/root/yan/lbm/fpga/lbm/device/cu.cl", "content":"/**\012this code is for colliding parallel */\012// this function is the prototype code for each cu kernels in N_VECTOR cu arrays\012AUTORUN TASK kernel void cu()\012{\012    real tau_f = read_channel_intel(DR2CU_REAL_CHANNEL);\012    while (true)\012    {\012        if (DEBUG)\012            printf(\"Cu getting data...\\n\");\012        CellVector cellvector = read_channel_intel(BD2CU_CELLVECTOR_CHANNEL);\012        write_channel_intel(CU2VW_CELLVECTOR_CHANNEL, cellvector);\012        FWithPosition fwithposition[N_VECTOR * N_VECTOR * Q_VECTOR];\012        int findex = 0;\012        int i = 0;\012        int j = 0;\012#pragma unroll\012        for (int n = 0; n < N_VECTOR * N_VECTOR; n++)\012        {\012            Cell cell = cellvector.cells[j][i];\012#pragma unroll\012            for (int m = 0; m < Q_VECTOR; m++)\012            {\012                int new_x = cell.position.x + e[m].x;\012                int new_y = cell.position.y + e[m].y;\012                FWithPosition ftmp = {bgk(cell.f[m], cell.rho, cell.u, m, tau_f), MakeVecIndex(new_x, new_y), m};\012                fwithposition[findex++] = ftmp;\012            }\012            if (++i == N_VECTOR)\012            {\012                i = 0;\012                j++;\012            }\012        }\012        // #pragma unroll\012        //         for (int j = 0; j < N_VECTOR; j++)\012        //         {\012        // #pragma unroll\012        //             for (int i = 0; i < N_VECTOR; i++)\012        //             {\012        //                 Cell cell = cellvector.cells[j][i];\012        // #pragma unroll\012        //                 for (int m = 0; m < Q_VECTOR; m++)\012        //                 {\012        //                     int new_x = cell.position.x + e[m].x;\012        //                     int new_y = cell.position.y + e[m].y;\012        //                     FWithPosition ftmp = {bgk(cell.f[m], cell.rho, cell.u, m, tau_f), MakeVecIndex(new_x, new_y), m};\012        //                     fwithposition[findex++] = ftmp;\012        //                 }\012        //             }\012        //         }\012        for (int i = 0; i < N_VECTOR * N_VECTOR * Q_VECTOR; i++)\012        {\012            write_channel_intel(CU2ISTREAMER_FWP_CHANNEL, fwithposition[i]);\012        }\012    }\012}"}, {"path":"/root/yan/lbm/fpga/lbm/device/data_reader.cl", "name":"data_reader.cl", "has_active_debug_locs":false, "absName":"/root/yan/lbm/fpga/lbm/device/data_reader.cl", "content":"/**\012read cell data from global buffer */\012TASK kernel void data_reader(\012    global Cell *restrict cells,\012    Index groupsize_x,\012    Index groupsize_y,\012    // Vector2DIndex groupsize, //groupsize*{N_VECTOR,N_VECTOR}\012    LongIndex ncells,\012    real u0x, real u0y,\012    real tau_f, int interval)\012{\012    // 将tau_f 参数传递给cus\012    write_channel_intel(DR2CU_REAL_CHANNEL, tau_f);\012    Vector2DIndex groupsize = MakeVecIndex(groupsize_x, groupsize_y);\012    Index size_x = groupsize.x * N_VECTOR;\012    // Vector2DIndex groupsize = MakeVecIndex(1, 1);\012    bool buf_flag = false;\012    int num_interval = interval;\012    Index y = 0;\012    Index x = 0;\012    Index offset = 0;\012    while (true)\012    {\012        // N_VECTOR * N_VECTOR vectorization : y * N_VECTOR * size_x + x * N_VECTOR\012        LongIndex groupstart = (y * size_x + x) * N_VECTOR + offset;\012\012        // ================start reader data==================\012        CellVector buffer;\012        int i = 0;\012        int j = 0;\012        LongIndex jstart = groupstart + j * size_x;\012#pragma unroll\012        for (int n = 0; n < N_VECTOR * N_VECTOR; n++)\012        {\012            // read data from global_mem\012            buffer.cells[j][i] = cells[jstart + i];\012            // compute rho and u\012            if (buffer.cells[j][i].mask == 0x0) //normal point\012            {\012                real rho = 0.f;\012                Vector2DReal u = {0.f, 0.f};\012#pragma unroll\012                for (int m = 0; m < Q_VECTOR; m++)\012                {\012                    rho += buffer.cells[j][i].f[m];\012                    u.x += e[m].x * buffer.cells[j][i].f[m];\012                    u.y += e[m].y * buffer.cells[j][i].f[m];\012                }\012                u.x /= rho;\012                u.y /= rho;\012                buffer.cells[j][i].rho = rho;\012                buffer.cells[j][i].u = u;\012            }\012            else if (ISUP(buffer.cells[j][i].mask)) // drive point\012            {\012                buffer.cells[j][i].u = MakeVecReal(u0x, u0y);\012                if (DEBUG)\012                    printf(\"data_reader u: cells(%d,%d).u=%f\\n\", cells[jstart + i].position.x, cells[jstart + i].position.y, buffer.cells[j][i].u.x);\012            }\012            if (DEBUG)\012                printf(\"data_reader: cells(%d,%d)=%d\\n\", cells[jstart + i].position.x, cells[jstart + i].position.y, jstart + i);\012            // compute index(j,i)\012            if (++i == N_VECTOR)\012            {\012                i = 0;\012                j++;\012                jstart = groupstart + j * size_x;\012            }\012        }\012        // #pragma unroll\012        //         for (int j = 0; j < N_VECTOR; j++)\012        //         {\012        //             LongIndex jstart = groupstart + j * size_x;\012        // #pragma unroll\012        //             for (int i = 0; i < N_VECTOR; i++)\012        //             {\012        //                 buffer.cells[j][i] = cells[jstart + i];\012        //                 // compute rho and u\012        //                 if (buffer.cells[j][i].mask == 0x0)\012        //                 {\012        //                     real rho = 0.f;\012        //                     Vector2DReal u = {0.f, 0.f};\012        // #pragma unroll\012        //                     for (int m = 0; m < Q_VECTOR; m++)\012        //                     {\012        //                         rho += buffer.cells[j][i].f[m];\012        //                         u.x += e[m].x * buffer.cells[j][i].f[m];\012        //                         u.y += e[m].y * buffer.cells[j][i].f[m];\012        //                     }\012        //                     u.x /= rho;\012        //                     u.y /= rho;\012        //                     buffer.cells[j][i].rho = rho;\012        //                     buffer.cells[j][i].u = u;\012        //                 }\012        //                 else if (ISUP(buffer.cells[j][i].mask))\012        //                 {\012        //                     buffer.cells[j][i].u = MakeVecReal(u0x, u0y);\012        //                     if (DEBUG)\012        //                         printf(\"data_reader u: cells(%d,%d).u=%f\\n\", cells[jstart + i].position.x, cells[jstart + i].position.y, buffer.cells[j][i].u.x);\012        //                 }\012        //                 if (DEBUG)\012        //                     printf(\"data_reader: cells(%d,%d)=%d\\n\", cells[jstart + i].position.x, cells[jstart + i].position.y, jstart + i);\012        //             }\012        //         }\012        // ================end reader data==================\012\012        // transfer data to boundary_detector\012        write_channel_intel(DATAR2BD_CELLVECTOR_CHANNEL, buffer);\012        if (DEBUG)\012            printf(\"data_reader:transfer group(%d,%d) to bd\\n\", x, y);\012\012        // compute index\012        if (++x == groupsize.x)\012        {\012            x = 0;\012            if (++y == groupsize.y)\012            {\012                y = 0;\012                // receive next iterate signal from streamer\012                read_channel_intel(ISTREAMER2DATAR_CHAR_CHANNEL);\012                if (DEBUG)\012                    printf(\"data_reader: get signal from Is\\n\");\012                read_channel_intel(BSTREAMER2DATAR_CHAR_CHANNEL);\012                if (DEBUG)\012                    printf(\"data_reader: get signal from Bs\\n\");\012                // receive interval from signal\012                if (--num_interval == 0)\012                {\012                    num_interval = interval;\012                    read_channel_intel(SINGALG2DATAR_CHAR_CHANNEL);\012                }\012                // ping-pong buffer, using offset\012                offset = ncells;\012                if (buf_flag)\012                    offset = 0;\012                buf_flag = !buf_flag;\012                if (DEBUG)\012                {\012                    printf(\"data_reader: interval= %d\\n\", num_interval);\012                    printf(\"data_reader: offset= %d\\n\", offset);\012                }\012            }\012        }\012    }\012}"}, {"path":"/root/yan/lbm/fpga/lbm/device/../host/inc/defines.h", "name":"defines.h", "has_active_debug_locs":false, "absName":"/root/yan/lbm/fpga/lbm/host/inc/defines.h", "content":"#ifndef __DEFINES_H__\012#define __DEFINES_H__\012/**\012 * define some fix value\012*/\012\012#define SUCCESS_EXIT 0\012#define D_VECTOR 2\012#define Q_VECTOR 9\012#define REAL0 0.f\012#define DEBUG true\012#define N_VECTOR 2\012// mask\012// 00(0) 01(1) 10(-1) (0,1,-1)\012#define UP 0x2    // (0,-1)0010\012#define DOWN 0x1  // (0,1)0001\012#define LEFT 0x4  // (1,0)0100\012#define RIGHT 0x8 // (-1,0)1000\012\012#define SETUP(x) x = (x | UP)\012#define SETDOWN(x) x = (x | DOWN)\012#define SETLEFT(x) x = (x | LEFT)\012#define SETRIGHT(x) x = (x | RIGHT)\012\012#define ISUP(x) ((x & UP) == UP)\012#define ISLEFT(x) ((x & LEFT) == LEFT)\012#define ISDOWN(x) ((x & DOWN) == DOWN)\012#define ISRIGHT(x) ((x & RIGHT) == RIGHT)\012\012#define SHIFT(x) (x << 4)\012\012typedef float real;\012typedef double dreal;\012typedef int Index;\012typedef int LongIndex;\012\012// 2 dimension model\012typedef struct\012{\012    real x;\012    real y;\012} Vector2DReal;\012\012typedef struct\012{\012    Index x;\012    Index y;\012} Vector2DIndex;\012\012// cell structure\012typedef struct\012{\012    Vector2DIndex position;\012    Vector2DReal u;\012    real rho;\012    real f[Q_VECTOR];\012    char mask;\012} Cell;\012\012// w and e\012#if defined(__OPENCL__)\012constant real w[Q_VECTOR] = {4.f / 9.f, 1.f / 9.f, 1.f / 9.f,\012                             1.f / 9.f, 1.f / 9.f, 1.f / 36.f,\012                             1.f / 36.f, 1.f / 36.f, 1.f / 36.f};\012constant Vector2DIndex e[Q_VECTOR] = {{0, 0},\012                                      {1, 0},\012                                      {0, 1},\012                                      {-1, 0},\012                                      {0, -1},\012                                      {1, 1},\012                                      {-1, 1},\012                                      {-1, -1},\012                                      {1, -1}};\012inline Vector2DIndex MakeVecIndex(Index x, Index y)\012{\012    Vector2DIndex vec = {x, y};\012    return vec;\012}\012\012inline Vector2DReal MakeVecReal(real x, real y)\012{\012    Vector2DReal vec = {x, y};\012    return vec;\012}\012inline real dotVecReal(Vector2DReal m, Vector2DReal n)\012{\012    return m.x * n.x + m.y * n.y;\012}\012inline real dotVecIndex_Real(Vector2DIndex m, Vector2DReal n)\012{\012    return m.x * n.x + m.y * n.y;\012}\012#else\012const static real w[Q_VECTOR] = {4.f / 9.f, 1.f / 9.f, 1.f / 9.f,\012                                 1.f / 9.f, 1.f / 9.f, 1.f / 36.f,\012                                 1.f / 36.f, 1.f / 36.f, 1.f / 36.f};\012const static Vector2DIndex e[Q_VECTOR] = {{0, 0},\012                                          {1, 0},\012                                          {0, 1},\012                                          {-1, 0},\012                                          {0, -1},\012                                          {1, 1},\012                                          {-1, 1},\012                                          {-1, -1},\012                                          {1, -1}};\012\012inline Vector2DIndex MakeVec(Index x, Index y)\012{\012    Vector2DIndex vec = {x, y};\012    return vec;\012}\012\012inline Vector2DReal MakeVec(real x, real y)\012{\012    Vector2DReal vec = {x, y};\012    return vec;\012}\012inline real dotVec(Vector2DReal m, Vector2DReal n)\012{\012    return m.x * n.x + m.y * n.y;\012}\012inline real dotVec(Vector2DIndex m, Vector2DReal n)\012{\012    return m.x * n.x + m.y * n.y;\012}\012\012#endif\012\012inline real computeVec(Vector2DReal v)\012{\012#if defined(__OPENCL__)\012    return sqrt(dotVecReal(v, v));\012#else\012    return sqrt(dotVec(v, v));\012#endif\012}\012\012inline LongIndex getIndex(Vector2DIndex position, Vector2DIndex size)\012{\012    return position.y * size.x + position.x;\012}\012\012inline real feq(real rho, Vector2DReal u, int i)\012{\012#if defined(__OPENCL__)\012    return rho * w[i] * (1.0 + 3.0 * dotVecIndex_Real(e[i], u) + 9.0 / 2.0 * dotVecIndex_Real(e[i], u) * dotVecIndex_Real(e[i], u) - 3.0 / 2.0 * dotVecReal(u, u));\012#else\012    return rho * w[i] * (1.0 + 3.0 * dotVec(e[i], u) + 9.0 / 2.0 * dotVec(e[i], u) * dotVec(e[i], u) - 3.0 / 2.0 * dotVec(u, u));\012#endif\012}\012// Bhatnagar-Gross-Kroop approximation collision operator\012inline real bgk(real f, real rho, Vector2DReal u, int i, real tau_f)\012{\012    //Without gravitational drag\012    return f - (f - feq(rho, u, i)) * tau_f;\012}\012inline real nfeq_boundary(real f, real rho, Vector2DReal u_interior, Vector2DReal u, int i)\012{\012    //Without gravitational drag\012    return feq(rho, u, i) + (f - feq(rho, u_interior, i));\012}\012#endif"}, {"path":"/root/yan/lbm/fpga/lbm/device/interior_streamer.cl", "name":"interior_streamer.cl", "has_active_debug_locs":false, "absName":"/root/yan/lbm/fpga/lbm/device/interior_streamer.cl", "content":"/**\012read cell data from global buffer */\012kernel void interior_streamer(\012    global Cell *restrict cells,\012    LongIndex ncells, Index size_x, Index size_y)\012{\012    bool buf_flag = false;\012    Vector2DIndex size = MakeVecIndex(size_x, size_y);\012    LongIndex fullsize = size.x * size.y * Q_VECTOR; // every cell has Q_VECTOR fs\012    // LongIndex count_flag = count / 3;\012    LongIndex count_flag = 0;\012    LongIndex count = fullsize;\012    LongIndex offset = ncells;\012#pragma ivdep\012    while (true)\012    {\012        // printf(\"interior_streamer%d\\n\", count);\012        FWithPosition fwp = read_channel_intel(CU2ISTREAMER_FWP_CHANNEL);\012        if (fwp.position.x > 0 && fwp.position.x < size.x - 1 && fwp.position.y > 0 && fwp.position.y < size.y - 1)\012        {\012            LongIndex cellIndex = getIndex(fwp.position, size) + offset;\012            cells[cellIndex].f[fwp.i] = fwp.f;\012        }\012        count--;\012        if (count == count_flag)\012            write_channel_intel(ISTREAMER2DATAR_CHAR_CHANNEL, '1');\012        if (count == 0)\012        {\012            count = fullsize;\012            // ping-pong buffer, using offset\012            offset = 0;\012            if (buf_flag)\012                offset = ncells;\012            buf_flag = !buf_flag;\012        }\012    }\012}"}, {"path":"/root/yan/lbm/fpga/lbm/device/lbm.cl", "name":"lbm.cl", "has_active_debug_locs":false, "absName":"/root/yan/lbm/fpga/lbm/device/lbm.cl", "content":"// some opencl for fpga defines\012#define USE_AUTORUN_KERNELS\012#define EMULATOR\012#if defined(USE_AUTORUN_KERNELS) && !defined(EMULATOR)\012#define AUTORUN __attribute__((autorun))\012#else\012#define AUTORUN\012#endif\012#define TASK __attribute__((max_global_work_dim(0)))\012\012#pragma OPENCL EXTENSION cl_intel_channels : enable\012#define __OPENCL__\012// some datas and funcs defines\012#include \"../host/inc/defines.h\"\012\012typedef struct\012{\012    Cell cells[N_VECTOR][N_VECTOR];\012} CellVector;\012\012typedef struct\012{\012    Cell cell;\012    Vector2DIndex offset;\012} CellWithBoundary;\012\012typedef struct\012{\012    CellWithBoundary cellwbs[N_VECTOR][N_VECTOR];\012} CellWithBoundaryVector;\012\012typedef struct\012{\012    real f;\012    Vector2DIndex position;\012    int i;\012} FWithPosition;\012\012// channel define\012channel char SINGALG2DATAR_CHAR_CHANNEL __attribute__((depth(1)));\012channel CellVector DATAR2BD_CELLVECTOR_CHANNEL __attribute__((depth(8)));\012channel char ISTREAMER2DATAR_CHAR_CHANNEL __attribute__((depth(1)));\012channel char BSTREAMER2DATAR_CHAR_CHANNEL __attribute__((depth(1)));\012channel CellVector BD2CU_CELLVECTOR_CHANNEL __attribute__((depth(8)));\012channel CellVector CU2VW_CELLVECTOR_CHANNEL __attribute__((depth(8)));\012channel real DR2CU_REAL_CHANNEL __attribute__((depth(1)));\012channel CellWithBoundaryVector BD2BU_CWBV_CHANNEL __attribute__((depth(8)));\012channel FWithPosition CU2ISTREAMER_FWP_CHANNEL __attribute__((depth(8)));\012channel Cell BU2BSTREAMER_CELL_CHANNEL __attribute__((depth(8)));\012channel char VW2SINGALG_CHAR_CHANNEL __attribute__((depth(1)));\012\012// top level\012#include \"boundary_detector.cl\"\012#include \"boundary_streamer.cl\"\012#include \"bu.cl\"\012#include \"cu.cl\"\012#include \"data_reader.cl\"\012#include \"interior_streamer.cl\"\012#include \"signal_generator.cl\"\012#include \"velocity_writer.cl\""}, {"path":"/root/yan/lbm/fpga/lbm/device/signal_generator.cl", "name":"signal_generator.cl", "has_active_debug_locs":false, "absName":"/root/yan/lbm/fpga/lbm/device/signal_generator.cl", "content":"/**\012    transfer signal from cpu to data_reader\012 */\012TASK kernel void signal_generator()\012{\012    write_channel_intel(SINGALG2DATAR_CHAR_CHANNEL, 'a');\012    char s = read_channel_intel(VW2SINGALG_CHAR_CHANNEL);\012    if (DEBUG)\012        printf(\"signal_generator: s= %c\\n\", s);\012}"}, {"path":"/root/yan/lbm/fpga/lbm/device/velocity_writer.cl", "name":"velocity_writer.cl", "has_active_debug_locs":false, "absName":"/root/yan/lbm/fpga/lbm/device/velocity_writer.cl", "content":"TASK kernel void velocity_writer(\012    global Vector2DReal *restrict u,\012    // Vector2DIndex groupsize, // groupsize*{N_VECTOR,N_VECTOR}\012    Index groupsize_x,\012    Index groupsize_y,\012    int num_interval // 迭代多少次\012)\012{\012    Vector2DIndex groupsize = MakeVecIndex(groupsize_x, groupsize_y);\012    Index num_group = groupsize.x * groupsize.y;\012    Index size_x = groupsize.x * N_VECTOR;\012    int interval = 0;\012    int m = 0;\012#pragma ivdep\012    while (true)\012    {\012        CellVector cell_vector = read_channel_intel(CU2VW_CELLVECTOR_CHANNEL);\012        if (interval == num_interval - 1)\012        {\012            // compute group start index\012            LongIndex groupstart = cell_vector.cells[0][0].position.y * size_x + cell_vector.cells[0][0].position.x;\012            // write velocity to ddr\012            int i = 0;\012            int j = 0;\012            LongIndex jstart = groupstart + j * size_x;\012#pragma unroll\012            for (int n = 0; n < N_VECTOR * N_VECTOR; n++)\012            {\012                // write u to global_mem\012                u[jstart + i] = cell_vector.cells[j][i].u;\012                if (DEBUG)\012                    printf(\"velocity_writer u: cells(%d,%d)(%d).u.x=%f\\n\", cell_vector.cells[j][i].position.x, cell_vector.cells[j][i].position.y, jstart + i, u[jstart + i].x);\012\012                if (++i == N_VECTOR)\012                {\012                    i = 0;\012                    j++;\012                    jstart = groupstart + j * size_x;\012                }\012            }\012            // #pragma unroll\012            //             for (int j = 0; j < N_VECTOR; j++)\012            //             {\012            //                 LongIndex jstart = groupstart + j * size_x;\012            // #pragma unroll\012            //                 for (int i = 0; i < N_VECTOR; i++)\012            //                 {\012            //                     u[jstart + i] = cell_vector.cells[j][i].u;\012            //                     if (DEBUG)\012            //                         printf(\"velocity_writer u: cells(%d,%d)(%d).u.x=%f\\n\", cell_vector.cells[j][i].position.x, cell_vector.cells[j][i].position.y, jstart + i, u[jstart + i].x);\012            //                 }\012            //             }\012        }\012        if (++m == num_group)\012        {\012            m = 0;\012            if (++interval == num_interval)\012            {\012                // 发送信号给主机\012                write_channel_intel(VW2SINGALG_CHAR_CHANNEL, '1');\012                interval = 0;\012            }\012        }\012        if (DEBUG)\012            printf(\"velocity_writer: read from cu group %d,interval=%d\\n\", m, interval);\012    }\012}"}];